<style type="text/css">
body{
    font-family: 'Cairo', sans-serif;
    font-size: 14px;
    font-weight: 400;
}
a{
    text-decoration: none;
    color: #000;
}

/* Start MatchList */
#match-list-viewer {
    width: 768px;
    position: relative;
    display: flex;
    flex-direction: column;
    margin: 0 auto;
}
.mc-block h6 {
    display: flex;
    justify-content: space-between;
    width: 100%;
}
.mc-block h6 span {
    border-bottom: 1px solid #f5b11c;
    position: relative;
    box-sizing: border-box;
    line-height: 41px;
    font-size: 20px;
}
.mc-block h6:first-of-type span+a svg {
    fill: #000;
    background-color: #eee;
    padding: 9px;
    border-radius: 50%;
    margin: 0;
    width: 14px;
    height: 14px;
    -webkit-transition: background-color .3s ease-out;
    -khtml-transition: background-color .3s ease-out;
    -moz-transition: background-color .3s ease-out;
    -ms-transition: background-color .3s ease-out;
    -o-transition: background-color .3s ease-out;
    transition: background-color .3s ease-out;
}
.cin_cntnr {
    background-color: #f7f7f7;
    box-shadow: 0 1px 1px #e2e2e2;
    display: flex;
    justify-content: center;
    flex-direction: column;
    align-items: center;
    width: 100%;
    margin-bottom: 10px;
    position: relative;
}
.c-i-next {
    display: flex;
    justify-content: center;
    width: 100%;
}
.cin_cntnr .c-i-next .m {
    width: 12%;
    padding-top: 20px;
    text-align: center;
}
.status {
    font-size: 10px;
    display: inline-block;
    width: 100%;
    background-color: #d88224;
    color: #fff;
    padding: 3px 0;
    text-align: center;
}
.status.live {
    background-color: #b40001;
    color: #fff;
    -webkit-animation: pulse linear 300ms infinite;
    -khtml-animation: pulse linear 300ms infinite;
    -moz-animation: pulse linear 300ms infinite;
    -ms-animation: pulse linear 300ms infinite;
    -o-animation: pulse linear 300ms infinite;
    animation: pulse linear 300ms infinite;
}
@keyframes pulse{0%{opacity:.8;}50%{opacity:1;}100%{opacity:.8;}}
.cin_cntnr .status {
    padding: 0 0 4px;
    max-width: 70px;
}
.c-i-next .f, .c-i-next .s {
    width: 44%;
    font-size: 14px;
    padding-top: 17px;
    position: relative;
}
.c-i-next .f {
    padding: 17px 0 0 80px;
    text-align: left;
}
.c-i-next .f a:nth-child(2), .c-i-next .s a {
    display: flex;
    align-items: center;
}
.c-i-next .f a:nth-child(2) {
    display: flex;
    align-items: center;
    flex-direction: row-reverse;
}
.c-i-next .s {
    padding: 17px 80px 0 0;
    text-align: right;
}
.c-i-next b {
    position: absolute;
    top: 5px;
    margin: 0 7px;
    color: #f0a306;
    font-size: 20px;
}
.c-i-next .s b {
    right: 0;
}
.c-i-next .f b {
    left: 0;
}
.mc-block .c-i-next b {
    font-size: 30px;
}
.cin_cntnr .c-i-next b {
    margin: 0 12px;
}

.c-i-next img{
    width: 40px;
    height: 40px;
    margin: 0 5px;
}

.match-aux {
    display: inline-block;
    width: 100%;
    color: #a9aaa7;
    margin-top: 10px;
    padding: 0 0 0 10px;
    text-align: center;
}
.cin_cntnr .match-aux {
    float: right;
    padding: 10px 0 8px;
}
.match-aux span {
    direction: rtl;
    font-size: .6em;
    display: inline-block;
    margin: 0 10px 15px 0;
}
.cin_cntnr .match-aux span {
    margin: 0 10px 5px 0;
}
.cin_cntnr .match-aux span {
    font-size: 14px;
}
.match-aux svg {
    width: 20px;
    height: 20px;
    fill: #a9aaa7;
    vertical-align: middle;
    margin: 0 5px;
}
</style>
