    $matchList  = $match->find('div[id="match-list-viewer"]',0);
    
    $matchListArray = $matchList->find('div[class="mc-block"]');
    
    
    for( $i = 0; $i < sizeof($matchListArray); $i++){
        echo $matchListArray[$i];
